import React, { useState, useEffect } from "react";
import axios from "axios";
import { Bar } from "react-chartjs-2";
import "./App.css";

import {
  Chart as ChartJS,
  BarElement,
  CategoryScale,
  LinearScale,
  Tooltip,
  Legend,
} from "chart.js";

ChartJS.register(BarElement, CategoryScale, LinearScale, Tooltip, Legend);

const backendUrl = "http://127.0.0.1:8000/api";

function App() {
  // Login/auth state
  const [loginUsername, setLoginUsername] = useState("");
  const [loginPassword, setLoginPassword] = useState("");
  const [auth, setAuth] = useState(null); // { username, password }
  const [loginError, setLoginError] = useState("");

  // App state
  const [file, setFile] = useState(null);
  const [dataset, setDataset] = useState(null);
  const [history, setHistory] = useState([]);
  const [error, setError] = useState("");

  const axiosAuthConfig = auth
    ? {
        auth: {
          username: auth.username,
          password: auth.password,
        },
      }
    : {};

  // ---------- LOGIN HANDLER ----------
  const handleLogin = async (e) => {
    e.preventDefault();
    setLoginError("");
    setError("");

    if (!loginUsername || !loginPassword) {
      setLoginError("Please enter username and password.");
      return;
    }

    try {
      // Test credentials against /hello/
      await axios.get(`${backendUrl}/hello/`, {
        auth: {
          username: loginUsername,
          password: loginPassword,
        },
      });

      // If successful, store auth
      setAuth({ username: loginUsername, password: loginPassword });
      setLoginError("");
    } catch (err) {
      console.error("Login error:", err);
      setLoginError("Invalid credentials or backend not running.");
      setAuth(null);
    }
  };

  // ---------- FILE UPLOAD ----------
  const handleFileChange = (e) => {
    setFile(e.target.files[0]);
  };

  const handleUpload = async () => {
    setError("");
    if (!auth) {
      setError("Please login first.");
      return;
    }
    if (!file) {
      setError("Please select a CSV file first.");
      return;
    }

    try {
      const formData = new FormData();
      formData.append("file", file);

      const res = await axios.post(`${backendUrl}/upload/`, formData, {
        ...axiosAuthConfig,
        headers: {
          "Content-Type": "multipart/form-data",
        },
      });

      console.log("Upload response:", res.data);
      setDataset(res.data);
      fetchHistory();
    } catch (err) {
      console.error("Upload error:", err);
      setDataset(null);
      setError(
        err.response?.data?.error ||
          err.response?.data?.detail ||
          "Upload failed. Check backend & CSV columns."
      );
    }
  };

  // ---------- HISTORY ----------
  const fetchHistory = async () => {
    if (!auth) return;
    try {
      const res = await axios.get(`${backendUrl}/datasets/`, axiosAuthConfig);
      console.log("History response:", res.data);
      setHistory(res.data);
    } catch (err) {
      console.error("History error:", err);
    }
  };

  useEffect(() => {
    if (auth) {
      fetchHistory();
    }
    // eslint-disable-next-line react-hooks/exhaustive-deps
  }, [auth]);

  // ---------- HELPERS ----------
  const getChartData = () => {
    if (!dataset || !dataset.summary) return null;
    const dist = dataset.summary.type_distribution || {};
    const labels = Object.keys(dist);
    const counts = Object.values(dist);

    return {
      labels,
      datasets: [
        {
          label: "Equipment Count by Type",
          data: counts,
        },
      ],
    };
  };

  const renderSummary = () => {
    if (!dataset || !dataset.summary) return <p>No dataset loaded yet.</p>;
    const s = dataset.summary;
    return (
      <div>
        <p>Total Count: {s.total_count ?? "-"}</p>
        <p>
          Average Flowrate:{" "}
          {s.average_flowrate !== undefined
            ? s.average_flowrate.toFixed(2)
            : "-"}
        </p>
        <p>
          Average Pressure:{" "}
          {s.average_pressure !== undefined
            ? s.average_pressure.toFixed(2)
            : "-"}
        </p>
        <p>
          Average Temperature:{" "}
          {s.average_temperature !== undefined
            ? s.average_temperature.toFixed(2)
            : "-"}
        </p>
      </div>
    );
  };

  const renderTable = () => {
    if (!dataset || !dataset.preview_rows || dataset.preview_rows.length === 0) {
      return <p>No preview data available.</p>;
    }

    const columns = Object.keys(dataset.preview_rows[0] || {});

    return (
      <table>
        <thead>
          <tr>
            {columns.map((col) => (
              <th key={col}>{col}</th>
            ))}
          </tr>
        </thead>
        <tbody>
          {dataset.preview_rows.map((row, idx) => (
            <tr key={idx}>
              {columns.map((col) => (
                <td key={col}>{row[col]}</td>
              ))}
            </tr>
          ))}
        </tbody>
      </table>
    );
  };

  const chartData = getChartData();

  // ---------- RENDER: LOGIN PAGE ----------
  if (!auth) {
    return (
      <div className="login-root">
        <div className="login-card">
          <h1 className="login-title">Login</h1>
          <p className="login-subtitle">
            Enter your Django admin credentials to access the visualizer.
          </p>

          {loginError && <div className="error-box">{loginError}</div>}

          <form className="login-form" onSubmit={handleLogin}>
            <div>
              <label>Username</label>
              <input
                type="text"
                value={loginUsername}
                onChange={(e) => setLoginUsername(e.target.value)}
                placeholder="admin"
              />
            </div>
            <div>
              <label>Password</label>
              <input
                type="password"
                value={loginPassword}
                onChange={(e) => setLoginPassword(e.target.value)}
                placeholder="Your password"
              />
            </div>
            <button type="submit" className="primary-btn login-btn">
              Login
            </button>
          </form>
        </div>
      </div>
    );
  }

  // ---------- RENDER: MAIN APP ----------
  return (
    <div className="app-root">
      <div className="app-card">
        <header className="app-header">
          <h1 className="app-title">
            Chemical Equipment Parameter Visualizer
          </h1>
          <p className="app-subtitle">
            Logged in as <strong>{auth.username}</strong>
          </p>
        </header>

        {error && <div className="error-box">{error}</div>}

        <div className="section">
          <div className="section-title">Upload CSV</div>
          <div className="upload-row">
            <input type="file" accept=".csv" onChange={handleFileChange} />
            <button className="primary-btn" onClick={handleUpload}>
              Upload CSV
            </button>
          </div>
        </div>

        <div className="section">
          <div className="section-title">Latest Dataset Summary</div>
          {renderSummary()}
        </div>

        <div className="section">
          <div className="section-title">Equipment Type Distribution</div>
          {chartData && (
            <div style={{ width: "400px", height: "300px" }}>
              <Bar data={chartData} />
            </div>
          )}
        </div>

        <div className="section">
          <div className="section-title">Preview (First 10 Rows)</div>
          {renderTable()}
        </div>

        <div className="section">
          <div className="section-title">Last 5 Datasets</div>
          <ul>
            {history.map((d) => (
              <li key={d.id}>
                {d.name} â€“ {new Date(d.uploaded_at).toLocaleString()}
              </li>
            ))}
          </ul>
        </div>
      </div>
    </div>
  );
}

export default App;
